class StickyHeadTable extends Component {

  state = {
	}

  componentDidMount(){
    axios.get('http://localhost:5000')
      .then((resp) => {
        this.setState({items: resp.data});
      })
      .catch((err) => {
        console.log(err);
      })
  }



  render (){
    let itemsList = <tr></tr>;
    let ctr = 0;
    if(this.state.items){
      console.log(this.state)
      itemsList = Object.keys(this.state.items)
      .map(item => {
        ctr++;
        return <tr key={ctr}><td>Hello</td></tr>;
      });
    }


    return (
      <div>
        <table>
        <thead>
            <tr>
                <th>Link</th>
                <th>Relative</th>
                <th>Last Modified</th>
                <th>Content Encoding</th>
                <th>Content Size</th>
                <th>Server</th>
            </tr>
        </thead>
        <tbody>
          {itemsList}

        </tbody>
      </table>
      </div>
    );
  }
}

export default StickyHeadTable;
